import React from "react";
import styled from "styled-components";
import Main from "./Main";

const Login = () => {
  return (
    <>
      <LoginContainer>
        <LoginWrapper>
          <h1>원티드 프리온보딩</h1>
          <InputZone>
            <div>
              아이디 <input />
            </div>
            <div>
              비밀번호 <input />
            </div>
          </InputZone>
          <button>로그인</button>
        </LoginWrapper>
      </LoginContainer>
    </>
  );
};

export default Login;

const LoginContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
`;

const LoginWrapper = styled.div`
  background-color: aliceblue;
  width: 500px;
  height: 500px;
  /* display: flex; */
  text-align: center;
  border-radius: 15px;
  border: 1px solid black;
`;

const InputZone = styled.div`
  display: flex;
  flex-direction: column;
  height: 60%;
  justify-content: center;
`;
